import React from 'react';
import { Jumbotron, Container } from 'react-bootstrap';

function Hero(){
    return(
        <Jumbotron>
            <Container>
                <Row>
                    <Col>
                        <h2>Gaofeng</h2>
                    </Col>
                </Row>
            </Container>
        </Jumbotron>
    );
}

export default Hero;
